import React from 'react';
import useAuth from './authenticate';
import SpotifyWebApi from 'spotify-web-api-node';
import TopTracks from './pages/TopTracks';
import TopArtists from './pages/TopArtists';
import DashboardNavbar from './DashboardNavbar';

import { useState, useEffect } from 'react';

export default function Dashboard(props) {

    let accessToken = "";

    if (props.useCode) {
        accessToken = useAuth(props.code);
    } else {
        accessToken = props.accessToken;
    }

    const spotifyApi = new SpotifyWebApi({
        clientId: "f1873ac026914cb6831c47fc00432b3e",
        clientSecret: "d48679c7e5b54de09d997515538f7913",
        redirectUri: "http://localhost:3000"
    });

    useEffect(() => {
        if (!accessToken) {
            return;
        } else {
            spotifyApi.setAccessToken(accessToken);
        }
    }, [accessToken]);

    let newProps = {
        code: "",
        accessToken: accessToken,
        useCode: false
    };

    return (
        <div>
            <h1>Dashboard</h1>
            <DashboardNavbar props={newProps} />
            <TopTracks accessToken={accessToken} />
            <TopArtists accessToken={accessToken} />
        </div>
    )
}
